  input: TEXT,F3XA,,"Delta has a federal registered PAC account for federal contributions
    and a non-federal bank account that we use for state and local contributions.  From
    time to time, some money is transferred from the federal account to the non-federal
    to use for the state and local purposes.  All expenses are paid by the connected
    organization and the federal account and no expenses are paid by the non-federal
    account.          As for the failure to report the $25,000 transfer of funds from
    the federal to the non-federal bank account, it was a clerical oversight that
    it was not included on the July report originally.  We apologize for any inconvenience
    caused by this failure to report and will be more diligent concerning reporting
    of these tranfsers in the future.    This amendment did cause that new total to
    be carried over to the subsequent reports for the remainder of the year, but that
    was the only change to those subsequent reports."
